import React from 'react';
import { BrowserRouter } from 'react-router-dom'
import NavBar from './components/navbar';


function App() {
  const ref = React.createRef();

  return (
    <div className="App">
    	<BrowserRouter>    
      		<NavBar ref={ref}/>
      	</BrowserRouter>	
    </div>
  );
}

export default App;
